import React from 'react';
import { useNavigate } from 'react-router-dom';
import UsersList from '../../components/UsersList';

const AdminDashboard = () => {
  const navigate = useNavigate();

  // Example data for additional lists
  const recentActivities = [
    { id: 1, text: 'User john@example.com logged in', time: '2 min ago' },
    { id: 2, text: 'New user registered: jane@example.com', time: '15 min ago' },
    { id: 3, text: 'Password reset for bob@example.com', time: '1 hour ago' },
    { id: 4, text: 'System backup completed', time: '3 hours ago' },
    { id: 5, text: 'Security audit initiated', time: '5 hours ago' }
  ];

  const upcomingTasks = [
    { id: 1, text: 'Review Q1 performance reports', priority: 'High' },
    { id: 2, text: 'Schedule team meeting', priority: 'Medium' },
    { id: 3, text: 'Update software licenses', priority: 'Low' },
    { id: 4, text: 'Prepare budget proposal', priority: 'High' },
    { id: 5, text: 'Conduct user satisfaction survey', priority: 'Medium' }
  ];

  return (
    <div className="admin-dashboard" style={{ padding: '20px', height: '100%', display: 'flex', flexDirection: 'column' }}>
      <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '20px', height: '100%' }}>
        {/* System Statistics Card */}
        <div className="dashboard-card" style={{ display: 'flex', flexDirection: 'column', justifyContent: 'space-between' }}>
          <h3>System Statistics</h3>
          <div className="stats-content" style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '1rem' }}>
            <div className="stat-item">
              <span className="stat-label">Total Users</span>
              <span className="stat-value">243</span>
            </div>
            <div className="stat-item">
              <span className="stat-label">Active Today</span>
              <span className="stat-value">46</span>
            </div>
            <div className="stat-item">
              <span className="stat-label">New This Week</span>
              <span className="stat-value">12</span>
            </div>
            <div className="stat-item">
              <span className="stat-label">Server Uptime</span>
              <span className="stat-value">99.9%</span>
            </div>
          </div>
        </div>

        {/* Users List Card */}
        <div className="dashboard-card" style={{ display: 'flex', flexDirection: 'column', overflow: 'hidden' }}>
          <h3>Users</h3>
          <div style={{ overflowY: 'auto', flex: 1 }}>
            <UsersList />
          </div>
        </div>

        {/* Recent Activities Card */}
        <div className="dashboard-card" style={{ display: 'flex', flexDirection: 'column', overflow: 'hidden' }}>
          <h3>Recent Activities</h3>
          <div style={{ overflowY: 'auto', flex: 1 }}>
            <ul className="activity-list" style={{ listStyle: 'none', padding: 0 }}>
              {recentActivities.map(activity => (
                <li key={activity.id} style={{ 
                  padding: '10px 0', 
                  borderBottom: '1px solid var(--light-gray)',
                  display: 'flex',
                  justifyContent: 'space-between'
                }}>
                  <span>{activity.text}</span>
                  <span style={{ color: '#666', fontSize: '0.8rem' }}>{activity.time}</span>
                </li>
              ))}
            </ul>
          </div>
        </div>

        {/* Upcoming Tasks Card */}
        <div className="dashboard-card" style={{ display: 'flex', flexDirection: 'column', overflow: 'hidden' }}>
          <h3>Upcoming Tasks</h3>
          <div style={{ overflowY: 'auto', flex: 1 }}>
            <ul className="activity-list" style={{ listStyle: 'none', padding: 0 }}>
              {upcomingTasks.map(task => (
                <li key={task.id} style={{ 
                  padding: '10px 0', 
                  borderBottom: '1px solid var(--light-gray)',
                  display: 'flex',
                  justifyContent: 'space-between',
                  alignItems: 'center'
                }}>
                  <span>{task.text}</span>
                  <span style={{ 
                    backgroundColor: 
                      task.priority === 'High' ? '#ff6b6b' : 
                      task.priority === 'Medium' ? '#feca57' : '#48dbfb', 
                    color: 'white',
                    padding: '3px 8px',
                    borderRadius: '12px',
                    fontSize: '0.7rem'
                  }}>
                    {task.priority}
                  </span>
                </li>
              ))}
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
